operators = ["+", "-", "*", "/", "(", ")", ";"]


def format_string_pow(s):
    pow_s = "**"
    index = s.find(pow_s)
    if index != -1:
        insert_id_s = 0
        if s[index - 1] == ')':
            closed = 0
            for i in range(index - 1, -1, -1):
                if s[i] == ')':
                    closed += 1
                elif s[i] == '(':
                    closed -= 1
                if closed == 0:
                    insert_id_s = i
                    break
        else:
            for i in range(index - 1, -1, -1):
                if s[i] in operators:
                    insert_id_s = i + 1
                    break

        insert_id_p = 0
        if s[index + 2] == '(':
            opened = 0
            for i in range(index + 2, len(s)):
                if s[i] == '(':
                    opened += 1
                elif s[i] == ')':
                    opened -= 1
                if opened == 0:
                    insert_id_p = i + 1
                    break
        else:
            for i in range(index + 2, len(s)):
                if s[i] in operators:
                    insert_id_p = i
                    break

        new_s = s[:insert_id_s] + "pow(" + s[insert_id_s:index] + "," + s[index + 2:insert_id_p] + ")" + s[insert_id_p:]

        return index, new_s
    else:
        return -1, s


def format_string_trig(s):
    new_s = s
    for i in range(6):
        new_s = new_s.replace(f"cos(q_{i})", f"c_{i}")
        new_s = new_s.replace(f"sin(q_{i})", f"s_{i}")
    return new_s


